import axios from 'axios';

export default async function checkNewFlag(flag) {
  console.log(flag)

  axios.post(`${process.env.REACT_APP_DEV_URL}ldps_workers`, {
    data: flag,
    headers: {
      'Contenct-Cache': 'no-cache',
      'Content-Type': 'text/plain',
    },
  })

  // axios.post(`${process.env.REACT_APP_DEV_URL}ldps_workers`, flag)
};
